export const PopupBlock = () => {
  const html = document.querySelector("html");
  if (html) {
    html.style.overflow = "hidden";
  }
  return (
    <div
      style={{
        position: "absolute",
        top: 0,
        width: "100%",
        height: "100%",
        backgroundColor: "black",
        opacity: 0.3,
        zIndex: 1,
      }}
    ></div>
  );
};
